import React from 'react'
import './CenterSection.css';

const CenterSection = () => {
  return (
    <div className="center-section">
        <h3>What I am up to</h3>
        <div className="center-section-text">
            <p>On campus, 
                I am leading hardware Devices division at Neurotech@Berkeley, 
                organizing the largest collegiate hackathon Cal Hacks, 
                and fostering machine learning community and events as a part of the external relations team at ML@B. I am working on speech synthesis BCIs at Berkeley Artificial Intelligence (BAIR) lab, in Berkeley Speech Group.</p>
        </div>
    </div>
  )
}

export default CenterSection;
